  false,\n\t\"url\": null,\n\t\"notes\": \"CRED shallow Conductivity-Temperature-Depth
  (CTD) casts are vertical profiles (max 30 meter depth, downcast only) of temperature,
  conductivity and pressure. Data are collected at select nearshore locations, both
  around islands or banks and within lagoons. Data processing was performed using
  Seabird Instrument's SeaSoft SBE Data Processing Software (http://www.seabird.com/software/SBEDataProcforWindows.htm).
  Data format is discreet, tabular (formatted, space delimited ASCII) files for each
  profile, with a full header as provided by SeaSoft. Raw file extension is HEX, processed
  file extension is CNV. The header contains latitude, longitude and other location
  information, as well as all data processing steps and settings. All dates and times
  are UTC. All positions are WGS84 decimal degrees. Contact Coral Reef Ecosystem Division
  (CRED), NOAA Pacific Island Fisheries Science Center for more information. https://www.pifsc.noaa.gov/cred/ocean_and_climate_change.php\",\n\t\"owner_org\":
